import './myProjectsStyle.css';

const MyProjects = () => (
    <div id='myProjects' className='containerMyProjects'>
        <div className='wrapMyProjects'>
            <p className='text'>
                Aquí les presentaré mis proyectos
            </p>

        </div>
    </div>
)

export default MyProjects
